import logo from './logo.svg';
import React, { Component } from 'react';
import './App.css';

class App extends React.Component {

  componentDidMount() {
    state = {
      latitude: null
    }

    navigator.geolocation.getCurrentPosition(function (positions) {
      console.log(positions.coords.latitude);
      this.setState({ latitude: positions.coords.latitude });
    })
  }
  render() {
    return 1;
  }
}

export default App;
